import React from "react";
import { Header, Container, Grid } from 'semantic-ui-react';

function CrossCountry() {
  return (
      <Container>
        <br/>
        <Header as ="h2" textAlign="center">Algo-Trix</Header>
        <Grid textAlign = "center">
            <p textAlign="center"> Software Engineering, Software Quality Assurance, React <br/>
              <span className="bold-list"> On Going</span></p>
        </Grid>
        <Container text>
          <hr/>
        </Container>
      </Container>
  );
}

export default CrossCountry;
